import React from 'react';
import TopNav from '../components/Navbar/TopNav';
import MonsteraFavourite from '../components/MonsteraFavourite';
import MariaFloristaFavourite from '../components/MariaFloristaFavourite';

//import {useNavigate} from 'react-router-dom';

const Favourites = () => {

    return(
        <div className='full_div'>
            <TopNav />
            <center><h1>This is your list of favorite products</h1></center>
            <center><h3>You can add items to your list by clicking the "Add to favourites" button in the plant page or the vendors profile!</h3></center>



            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '80%', margin: '0 auto' }}>
                <div><h3>Here you can see your favorite products:</h3></div>
                <div className = "product"style={{ border: '2px solid green', padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '45%' }}>
                    <MonsteraFavourite></MonsteraFavourite>
                </div>
                <div className = "product" style={{ border: '2px solid green', padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '45%' }}>
                    <div><h3>Here you can see your favorite sellers:</h3></div>
                    <MariaFloristaFavourite></MariaFloristaFavourite>
                </div>
            </div>

        </div>
    );
}
export default Favourites;
